import Vue from 'vue';
import Router from 'vue-router';
import HelloContainer from "./components/HelloWorld.vue"; //1.引入自定义组件

import TestContainer from "./components/testContainer.vue";
import First from "./components/first.vue";
import ListContainer from "./components/listContainer.vue";
import homeContainer from "./components/tabbar/HomeContainer.vue";
import newsListContainer from "./components/news/newsListContainer.vue";
import newinfoContainer from "./components/news/newinfoContainer.vue";
import shopContainer from "./components/tabbar/ShopContainer.vue";
Vue.use(Router); //配置路径{path:路径,component:组件名称}

export default new Router({
  routes: [{
    path: '/',
    redirect: '/home'
  }, {
    path: '/test',
    component: TestContainer
  }, {
    path: '/zhuzhu',
    component: First
  }, {
    path: '/list',
    component: ListContainer
  }, {
    path: '/home',
    component: homeContainer
  }, {
    path: '/home/newslist',
    component: newsListContainer
  }, {
    path: '/home/newsinfo',
    component: newinfoContainer
  }, {
    path: '/home/shop',
    component: shopContainer
  }]
});
